import React from "react";

//https://react-bootstrap.github.io/
export function MainContent() {
    return (
        <div>
            <h1>John Doe</h1>
            <ol>
                <li>It is fun</li>
                <li>Large community</li>
                <li>Popularity</li>
            </ol>
        </div>
    );
}
